import React from 'react';

import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <button>TechEd</button>
        <button>About</button>
        <button>Pricing</button>
        <button>Our Difference</button>
        <button>Contact</button>
        <button>Login</button>
        <button>Sign Up</button>
      </header>
      <body>
      Body
      </body>
      <footer>
        footer
      </footer>
    </div>
  );
}

export default App;
